import React, { Component } from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
  border: 10px solid green;
  border-top-color: transparent;
  border-radius: 50%;
  width: 120px;
  height: 120px;
  display: flex;
  align-items: center;
  justify-content: center;
`

const Font = styled.p`
  font-family: 'Font Awesome Solid';
  font-size: 3rem;

  &:before {
    content: '\f5fc';
  }
`

const Progress = styled.div`
  font-size: 20px;
  margin: 20px;
  position: relative; /* so that children can be absolutely positioned */
  padding: 0;
  width: 5em;
  height: 5em;
  background-color: #f2e9e1;
  border-radius: 50%;
  line-height: 5em;
  float: left;

  &:after {
    border: none;
    position: absolute;
    top: 0.35em;
    left: 0.35em;
    text-align: center;
    display: block;
    border-radius: 50%;
    width: 4.3em;
    height: 4.3em;
    background-color: white;
    content: ' ';
  }
`

const Span = styled.span`
  position: absolute;
  line-height: 5em;
  width: 5em;
  text-align: center;
  display: block;
  color: #53777a;
  z-index: 2;
`

const Left = styled.div`
  /* a round circle */
  border-radius: 50%;
  width: 5em;
  height: 5em;
  position: absolute; /* needed for clipping */
  clip: rect(0, 5em, 5em, 2.5em); /* clips the whole left half*/
`

class Icon extends Component {
  render() {
    return (
      <Progress>
        <Span>sdfsd</Span>
      </Progress>
    )
  }
}

export default Icon
